Pates: semoule de blé dur; purée de tomates, concentré double (29%); préparation d'épices (4,5%): sel de cuisine (30%), oignons, amidon
modifié, amidon, sucre, protéines de blé, de soya de maïs hydrolysées, herbes (contiennent céleri, ail, épices, poudre de betterave rouge;
fromage demi-gras à pâte extra-dure râpé (2,5%).
